('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'IP3151', 'Induction Programme', 'The Induction Programme helped me understand the importance of ethics, teamwork, and adapting to the college environment. The sessions on motivation, time management, and communication skills were very useful. Interactive activities and expert talks made the experience engaging and informative.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'HS3152', 'Professional English - I', 'The course improved my communication, writing, and presentation skills significantly. The grammar exercises, reading passages, and speaking sessions were well-structured. The teaching approach made the classes interactive and helped build confidence in English usage.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'MA3151', 'Matrices and Calculus', 'The subject strengthened my understanding of fundamental mathematical concepts like matrices, differentiation, and integration. The problem-solving sessions and examples from engineering applications made the concepts clear. The pace of teaching and clarity of explanations were very good.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'PH3151', 'Engineering Physics', 'Engineering Physics helped me connect physical principles to real-world engineering systems. The lessons on quantum physics, optics, and materials science were interesting. The teacher’s explanations and use of examples made complex topics easier to understand.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'CY3151', 'Engineering Chemistry', 'The course provided a strong foundation in chemical principles relevant to engineering. Topics like water treatment, corrosion, and energy sources were clearly explained. The teaching methods and real-world examples helped relate theory to practice.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'GE3151', 'Problem Solving and Python Programming', 'This subject introduced problem-solving using Python in a clear and structured way. The examples and coding exercises helped me develop logical thinking and programming skills. The sessions were well-paced and encouraged practical application of concepts', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'GE3152', 'தமிழர் மரபு / Heritage of Tamils', 'The course provided deep insights into Tamil culture, heritage, and ancient traditions. It created a sense of pride and awareness about the Tamil civilization’s contributions to art, science, and literature. The lectures were informative and engaging.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'GE3171', 'Problem Solving and Python Programming Laboratory', 'The lab sessions provided excellent hands-on experience with Python. The experiments were designed to build logical reasoning and programming confidence. The guidance from faculty was helpful in understanding debugging and efficient coding.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'BS3171', 'Physics and Chemistry Laboratory', 'The combined lab gave a practical understanding of scientific concepts discussed in theory classes. Experiments were well-organized, and the demonstrations helped connect theory with practice. The lab sessions improved my observation and analytical skills', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem I', 'GE3172', 'English Laboratory', 'The English lab sessions helped in improving listening, speaking, and pronunciation skills. Activities like role plays, JAM sessions, and interactive recordings made the learning experience enjoyable and effective.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'HS3252', 'Professional English - II', 'This course improved my ability to communicate effectively in professional and academic settings. The lessons focused on writing reports, preparing resumes, and improving presentation skills, which were very useful. The activities and discussions encouraged teamwork and confidence in using English fluently.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'MA3251', 'Statistics and Numerical Methods', 'The subject provided a strong foundation in probability, statistics, and numerical techniques essential for engineering applications. The teacher explained concepts clearly with relevant examples and solved problems that enhanced analytical thinking. The tutorial sessions were helpful in understanding complex topics.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'PH3256', 'Physics for Information Science', 'This subject gave valuable insights into semiconductor physics, laser technology, and communication principles relevant to information technology. The explanations were clear, and real-world applications were well connected to theoretical concepts. It helped understand the physics behind modern computing systems.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'BE3251', 'Basic Electrical and Electronics Engineering', 'The course helped in understanding the fundamentals of electrical circuits, electronic devices, and their practical applications. The teaching was clear and systematic, making it easier to grasp the basics of current, voltage, and logic circuits. The examples related to real-world systems made the subject interesting.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'GE3251', 'Engineering Graphics', 'Engineering Graphics developed my visualization, drawing, and design interpretation skills. The hands-on practice with orthographic projections, isometric drawings, and solid modeling improved my accuracy and creativity. The instructor’s guidance and clarity of explanation were excellent.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'AD3251', 'Data Structures Design', 'This course enhanced my understanding of data organization and algorithm efficiency. The teaching made complex topics like linked lists, stacks, queues, trees, and graphs easy to understand. Problem-solving sessions improved logical thinking and coding ability.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'GE3252', 'தமிழரும் தொழில்நுட்பமும் / Tamils and Technology', 'The subject beautifully connected Tamil heritage with scientific and technological contributions. It highlighted the innovative mindset and technical excellence of ancient Tamils. The sessions were informative and encouraged cultural pride and awareness.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'GE3271', 'Engineering Practices Laboratory', 'The lab sessions were very informative and provided practical exposure to various engineering domains. Performing experiments in electrical, civil, mechanical, and IT streams gave hands-on understanding of fundamental engineering principles. The instructors were supportive and ensured safety and clarity during all sessions.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'AD3271', 'Data Structures Design Laboratory', 'The lab gave strong practical exposure to implementing data structures using C and Python. The exercises helped in understanding how different data structures optimize storage and improve performance. Regular coding practice improved problem-solving speed and logical clarity.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem II', 'GE3272', 'Communication Laboratory / Foreign Language', 'The communication lab improved my listening, speaking, and pronunciation skills through interactive sessions. The activities such as role plays, presentations, and audio exercises enhanced my confidence in professional communication. The learning environment was supportive and enjoyable.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem V', 'CS3160', 'Deep Learning', 'The subject provided an in-depth understanding of neural networks, convolutional and recurrent models, and advanced deep learning architectures. The faculty explained concepts with clarity and related them to real-world AI applications, which made the learning process highly engaging. The course strengthened my understanding of model training, optimization, and evaluation techniques.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem V', 'CS3161', 'Data and Information Security', 'This course effectively introduced the fundamental concepts of cybersecurity, encryption, and information assurance. The lessons on cryptography, authentication, and network security protocols were well explained and relevant to current industry needs. The examples and case studies helped connect theoretical knowledge with real-world security challenges.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem V', 'CS3162', 'Distributed Computing', 'The subject provided clear insights into distributed systems, communication models, and synchronization techniques. The instructor’s explanations made complex topics like consistency, fault tolerance, and distributed file systems easy to understand. The course enhanced my understanding of scalable system architectures and modern cloud-based computing environments.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem V', 'CS3163', 'Big Data Analytics', 'This course gave a strong foundation in handling and processing large-scale datasets. The topics on Hadoop, MapReduce, and Spark were explained clearly, along with real-world applications in analytics. The teaching emphasized both theory and practice, improving my data handling and problem-solving skills.', '', '2025-11-04 15:43:28'),
('ISWARIYALAKSHMI T', '953623243039', '2021', 'Sem V', 'CS3175', 'Deep Learning Laboratory', 'The lab provided excellent hands-on experience in implementing neural networks using frameworks like TensorFlow and Keras. The experiments helped in understanding model training, fine-tuning, and performance evaluation for various applications like image classification and NLP. The instructor’s guidance ensured a strong grasp of both coding and conceptual aspects.', '', '2025-11-04 15:43:28'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'GE3252', 'தமிழரும் தொழில்நுட்பமும் / Tamils and Technology', 'The subject provided a deep understanding of how Tamil civilization contributed to various fields of science and technology. The classes highlighted historical innovations and their modern relevance effectively.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'GE3271', 'Engineering Practices Laboratory', 'The lab sessions offered hands-on experience across various engineering domains, including civil, mechanical, electrical, and electronics. The experiments were well organized and helped in understanding practical applications of theoretical concepts.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'AD3271', 'Data Structures Design Laboratory', 'The lab sessions reinforced the theory by allowing us to implement various data structures using programming. Writing code for stacks, queues, and trees improved my coding logic and problem-solving ability. The instructor provided clear guidance and timely feedback.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'GE3272', 'Communication Laboratory / Foreign Language', 'The communication lab enhanced my speaking and listening skills through interactive exercises and presentations. The sessions were well structured and helped improve confidence in using English (or the chosen foreign language) in professional contexts.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'MA3252', 'Discrete Mathematics', 'The course provided a strong foundation in mathematical reasoning essential for computer science. Topics such as logic, graph theory, and combinatorics were well explained with clear examples. The instructor ensured that theoretical concepts were connected to computational applications.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'CS3151', 'Digital Principles and Computer Organization', 'This subject clearly explained the internal structure and functioning of a computer system. The topics on logic gates, flip-flops, memory, and CPU organization were taught systematically, helping to understand how hardware and software interact.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'CS3152', 'Database Design and Management', 'The course gave a solid understanding of database concepts, normalization, and SQL queries. The faculty explained topics like relational models and ER diagrams in an easy and practical manner. Hands-on query examples made learning effective.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'CS3153', 'Design and Analysis of Algorithms', 'This course enhanced analytical and problem-solving skills through efficient algorithm design. Concepts such as divide and conquer, dynamic programming, and greedy algorithms were well structured. The instructor encouraged critical thinking and clarity in approach.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'CS3154', 'Data Exploration and Visualization', 'The subject introduced modern techniques for analyzing and visualizing data effectively. The sessions on data cleaning, analysis, and visualization tools were practical and informative. The course bridged theory and real-world data applications well.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'CS3155', 'Artificial Intelligence', 'The course provided a comprehensive introduction to AI concepts such as search algorithms, knowledge representation, and reasoning. The faculty explained each topic clearly and connected them to real-world AI applications.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'CS3171', 'Database Design and Management Laboratory', 'The lab sessions offered practical experience in designing and managing databases. Writing SQL queries and building simple database applications helped strengthen theoretical knowledge. The exercises were well planned and progressively challenging.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem III', 'CS3172', 'Artificial Intelligence Laboratory', 'The lab provided hands-on exposure to implementing AI algorithms like search strategies, expert systems, and basic machine learning tasks. It was engaging and helped solidify theoretical learning through coding practice.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem V', 'CS3160', 'Deep Learning', 'The course provided an in-depth understanding of neural networks and deep learning architectures such as CNNs and RNNs. The faculty explained theoretical concepts clearly and related them to practical applications, which made complex topics easier to grasp.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem V', 'CS3161', 'Data and Information Security', 'This subject gave a comprehensive overview of data protection, encryption, and cybersecurity principles. The instructor effectively explained various security mechanisms and their importance in safeguarding digital information.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem V', 'CS3162', 'Distributed Computing', 'The course offered a strong foundation in distributed systems concepts, covering process synchronization, communication, and fault tolerance. The faculty’s clear explanations helped in understanding complex architectures and algorithms.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem V', 'CS3163', 'Big Data Analytics', 'This subject introduced the key concepts and technologies for handling and analyzing large datasets effectively. The course covered Hadoop, Spark, and data pipelines in a well-structured way, bridging theory with real-world applications.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem V', 'CS3175', 'Deep Learning Laboratory', 'The lab sessions provided excellent hands-on experience in building and training deep learning models using frameworks like TensorFlow and PyTorch. Implementing various architectures improved both coding and analytical skills.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'IP3151', 'Induction Programme', 'The induction programme was informative and helpful in understanding the campus environment, academic regulations, and student support systems. The sessions on ethics, teamwork, and personal development were particularly useful in building confidence and communication skills.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'HS3152', 'Professional English - I', 'The course improved my communication and writing skills effectively. The lessons on grammar, report writing, and presentation skills were practical and relevant to professional needs. The instructor provided clear explanations and constructive feedback.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'MA3151', 'Matrices and Calculus', 'This subject provided a strong foundation in essential mathematical concepts required for engineering. The faculty explained topics like differentiation, integration, and matrices in a clear and structured way. Regular problem-solving sessions reinforced understanding.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'PH3151', 'Engineering Physics', 'The course effectively linked physics concepts to engineering applications. Topics such as quantum theory, optics, and materials science were well explained. The teaching methods encouraged curiosity and conceptual understanding.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'CY3151', 'Engineering Chemistry', 'The subject provided valuable insight into the chemical principles underlying various engineering processes. The faculty explained concepts like corrosion, water treatment, and polymers in a clear and concise way.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'GE3151', 'Problem Solving and Python Programming', 'The course introduced programming fundamentals effectively. The topics on algorithms, loops, and functions were well structured, and examples helped in understanding real-world problem solving. The instructor ensured that beginners were comfortable with Python syntax.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'GE3152', 'தமிழர் மரபு / Heritage of Tamils', 'The subject helped in understanding the rich cultural, historical, and literary heritage of the Tamil community. The discussions on ancient literature and traditions were engaging and informative.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'GE3171', 'Problem Solving and Python Programming Laboratory', 'The lab sessions provided hands-on experience with Python programming. Working on basic problem statements and mini projects enhanced understanding of coding concepts. The instructor was supportive and clarified doubts effectively.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'BS3171', 'Physics and Chemistry Laboratory', 'The laboratory sessions reinforced theoretical concepts through practical experiments. Safety procedures and proper handling of instruments were well emphasized. The experiments were relevant and informative.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem I', 'GE3172', 'English Laboratory', 'The lab sessions greatly improved listening and speaking skills. Activities like group discussions, role plays, and pronunciation practice helped build confidence in communication. The environment was interactive and supportive.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'HS3252', 'Professional English - II', 'The course helped strengthen my professional communication and presentation skills. The lessons on technical writing, report preparation, and public speaking were very practical and well explained. The activities encouraged confidence and clarity in communication.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'MA3251', 'Statistics and Numerical Methods', 'This subject built a solid understanding of statistical and numerical techniques essential for data analysis and problem-solving. The faculty explained each method clearly, with practical examples related to engineering. The balance between theory and problem-solving was well maintained.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'PH3256', 'Physics for Information Science', 'The course effectively connected physics concepts with information science applications. Topics like semiconductors, lasers, and fiber optics were clearly taught with real-world relevance. The instructor made complex concepts easy to grasp through examples.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'BE3251', 'Basic Electrical and Electronics Engineering', 'This course provided a good introduction to the fundamentals of electrical and electronic systems. The faculty explained circuit theory, diodes, and transistors in a structured and easy-to-understand manner. The content was well balanced between theory and practical understanding.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'GE3251', 'Engineering Graphics', 'Engineering Graphics improved my visualization and drawing skills. The instructor guided us well through orthographic projections, isometric drawings, and 3D views. The hands-on practice helped in developing accuracy and clarity in design representation.', '', '2025-11-04 15:43:52'),
('ARUNADEVI L', '953623243012', '2021', 'Sem II', 'AD3251', 'Data Structures Design', 'This course gave a strong foundation in understanding how data structures like arrays, linked lists, stacks, queues, and trees work. The concepts were explained clearly with good problem examples. The faculty encouraged logical thinking and coding practice.', '', '2025-11-04 15:43:52'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'IP3151', 'Induction Programme', 'The Induction Programme was a useful introduction to campus life, academic culture, and professional ethics. It helped students adapt to the new environment and understand the expectations of engineering education. Sessions on motivation, time management, and mental wellness were especially beneficial.', 'More interactive or practical sessions could make the programme more engaging.', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'HS3152', 'Professional English - I', 'The course effectively enhanced communication skills, vocabulary, and confidence in English usage. Activities like group discussions, role plays, and presentations helped in improving fluency and comprehension. The focus on both written and spoken English made the course balanced and practical.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'MA3151', 'Matrices and Calculus', 'The subject built a strong mathematical foundation essential for engineering. The topics were well structured, and the integration of theory with problem-solving exercises strengthened analytical thinking. The pace of teaching was appropriate, and tutorial sessions clarified doubts effectively.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'PH3151', 'Engineering Physics', 'The course provided a clear understanding of fundamental physics principles relevant to engineering. Topics like optics, quantum mechanics, and materials science were taught with clarity. The explanations and demonstrations supported conceptual understanding.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'CY3151', 'Engineering Chemistry', 'Engineering Chemistry covered essential concepts in materials, electrochemistry, and corrosion — all relevant to engineering practice. The lectures were informative, and the examples used helped relate chemistry to engineering fields.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'GE3151', 'Problem Solving and Python Programming', 'This course was a great introduction to computational thinking and basic programming. It helped students develop logical reasoning and problem-solving skills. The Python examples were simple and effective for beginners.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'GE3152', 'தமிழர் மரபு / Heritage of Tamils', 'The course provided valuable insights into Tamil heritage, language, and cultural evolution. It fostered appreciation for Tamil civilization and its global contributions. The content was both informative and inspiring.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'GE3171', 'Problem Solving and Python Programming Laboratory', 'The lab sessions were very helpful in applying the concepts learned in theory. Hands-on coding exercises strengthened programming skills and improved logical thinking. The step-by-step approach to solving problems using Python was effective.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'BS3171', 'Physics and Chemistry Laboratory', 'The combined lab provided valuable experimental exposure to core physics and chemistry concepts. Performing experiments helped in understanding theoretical principles better. The laboratory sessions improved observation, measurement, and reporting skills.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem I', 'GE3172', 'English Laboratory', 'The English lab sessions improved pronunciation, listening comprehension, and conversational fluency. Interactive activities like JAM sessions and group discussions helped in building confidence. The software-based exercises were very useful.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'HS3252', 'Professional English - II', 'The course effectively enhanced students’ professional communication skills, including report writing, presentation, and interview techniques. The lessons were practical and well-structured, with a good balance between theory and practice. The activities encouraged participation and built confidence in formal communication.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'MA3251', 'Statistics and Numerical Methods', 'The subject provided a strong foundation in statistical concepts and numerical analysis. The practical approach to solving mathematical problems using numerical techniques was beneficial for understanding data-driven engineering problems. The tutorials helped in reinforcing complex concepts.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'PH3256', 'Physics for Information Science', 'The course successfully connected physical principles with information science applications, especially in semiconductors, optics, and materials. The examples used were relevant and helped relate theory to real-world technologies.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'BE3251', 'Basic Electrical and Electronics Engineering', 'The subject covered the fundamentals of electrical circuits and electronic devices comprehensively. The explanations were clear, and the theoretical knowledge was well supported by problem-solving sessions.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'GE3251', 'Engineering Graphics', 'The course improved students’ visualization and technical drawing skills. The introduction of CAD tools and orthographic projection exercises was highly beneficial. The practical sessions reinforced spatial understanding effectively.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'AD3251', 'Data Structures Design', 'This subject provided a clear understanding of various data structures and their applications in problem-solving. The lectures and examples helped in developing algorithmic thinking and efficient coding practices.', '', '2025-11-04 15:43:57');
INSERT INTO `filtered_reviews__8_` (`COL 1`, `COL 2`, `COL 3`, `COL 4`, `COL 5`, `COL 6`, `COL 7`, `COL 8`, `COL 9`) VALUES
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'GE3252', 'தமிழரும் தொழில்நுட்பமும் / Tamils and Technology', 'The course provided deep insight into the contributions of Tamil scholars to science and technology. It effectively connected language, culture, and modern technological development.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'GE3271', 'Engineering Practices Laboratory', 'The lab sessions were practical and informative, covering essential engineering skills like carpentry, fitting, wiring, and plumbing. The hands-on approach improved technical confidence and teamwork.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'AD3271', 'Data Structures Design Laboratory', 'The lab provided hands-on experience in implementing various data structures. It reinforced theoretical knowledge through coding exercises and algorithm optimization tasks. The experiments were well-organized and relavent.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem II', 'GE3272', 'Communication Laboratory / Foreign Language', 'The lab helped improve listening, speaking, and pronunciation skills in a professional and global context. The use of audio-visual materials made the sessions interactive and engaging.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'MA3252', 'Discrete Mathematics', 'The course provided a solid foundation in mathematical reasoning, logic, set theory, and graph theory, which are essential for computer science. The concepts were well explained, and tutorial sessions helped strengthen problem-solving skills. The subject effectively bridged theoretical mathematics and its applications in computing.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'CS3151', 'Digital Principles and Computer Organization', 'This course offered a deep understanding of digital logic design, combinational and sequential circuits, and the internal architecture of computer systems. The progression from basic logic gates to CPU organization was well structured. The tutorials helped reinforce theoretical knowledge through practical examples.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'CS3152', 'Database Design and Management', 'The course effectively introduced the principles of database systems, including data modeling, normalization, and SQL queries. The real-world examples and case studies helped understand relational database design and management. The focus on query optimization and database security added strong practical value.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'CS3153', 'Design and Analysis of Algorithms', 'The subject strengthened analytical and problem-solving skills through algorithm design paradigms such as divide-and-conquer, dynamic programming, and greedy methods. The instructor’s detailed explanations and examples improved clarity in algorithm efficiency and complexity analysis.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'CS3154', 'Data Exploration and Visualization', 'This course provided an excellent introduction to data preprocessing, statistical analysis, and visualization techniques. The lessons on using visualization tools and interpreting data insights were practical and relevant. The subject encouraged critical thinking and analytical reasoning.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'CS3155', 'Artificial Intelligence', 'The course offered a strong conceptual understanding of AI fundamentals, including search algorithms, knowledge representation, and reasoning. It provided a good balance between theory and applications. The examples and problem discussions helped in understanding real-world AI challenges.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'CS3171', 'Database Design and Management Laboratory', 'The lab sessions allowed students to apply theoretical knowledge by designing and managing databases using SQL. Exercises such as creating schemas, writing queries, and implementing constraints were valuable for gaining hands-on experience. The experiments were well-structured and relevant to the theory course.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem III', 'CS3172', 'Artificial Intelligence Laboratory', 'The lab provided practical exposure to implementing AI algorithms such as search techniques, game playing, and knowledge representation. The hands-on exercises helped strengthen understanding of theoretical AI concepts. The use of programming environments like Python made the sessions interactive and practical.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem V', 'CS3160', 'Deep Learning', 'The course provided a comprehensive understanding of neural network architectures and their applications in real-world problems. The topics on convolutional and recurrent neural networks were well explained, and the instructor effectively connected theory with modern AI applications. The mathematical foundations behind deep learning concepts were also covered clearly.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem V', 'CS3161', 'Data and Information Security', 'This course offered a strong conceptual and practical understanding of data protection, cryptography, network security, and access control mechanisms. The examples and case studies related to real-world cyber threats helped students grasp the importance of secure computing practices. The course emphasized both theoretical depth and practical application.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem V', 'CS3162', 'Distributed Computing', 'The subject gave an excellent overview of distributed system principles, communication models, synchronization, and fault tolerance. The course effectively connected distributed computing concepts with real-world systems like cloud platforms and microservices. The logical organization of topics made it easy to follow and understand complex interactions among distributed components.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem V', 'CS3163', 'Big Data Analytics', 'he course provided a detailed introduction to big data frameworks, storage, and processing techniques. The discussions on Hadoop, MapReduce, and Spark were informative and helped students understand large-scale data handling. The emphasis on data-driven decision-making and scalability was very relevant to current industry practices.', '', '2025-11-04 15:43:57'),
('Pradhoushini P S', '953623243077', '2021', 'Sem V', 'CS3175', 'Deep Learning Laboratory', 'The lab sessions offered hands-on experience in building, training, and evaluating deep learning models. Students gained practical exposure to implementing architectures like CNNs and RNNs using frameworks such as TensorFlow or PyTorch. The experiments were well-structured and reinforced theoretical concepts effectively.', '', '2025-11-04 15:43:57'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'IP3151', 'Induction Programme', 'The Induction Programme was well-structured and helped students adapt to the college environment smoothly.', 'It would be great to include more hands-on sessions or industry interaction to make it even more engaging.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'HS3152', 'Professional English - I', 'The course improved my communication and writing skills significantly.', 'Including more group discussions or mock interviews would further improve speaking and presentation skills.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'MA3151', 'Matrices and Calculus', 'The subject provided a strong foundation in essential mathematical concepts.', 'Additional real-world applications or software-based demonstrations (like MATLAB or Python) could make the concepts more relatable.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'PH3151', 'Engineering Physics', 'The course was informative and covered key areas like quantum physics, optics, and materials science.', 'More demonstration videos or simulations could make complex physical concepts easier to visualize.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'CY3151', 'Engineering Chemistry', 'The subject gave a solid understanding of fundamental chemical principles used in engineering.', 'Including mini-projects or case studies could enhance the learning experience.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'GE3151', 'Problem Solving and Python Programming', 'This course introduced programming in an easy and logical way.', 'Providing more coding challenges and small projects would help strengthen programming skills further.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'GE3152', 'தமிழர் மரபு / Heritage of Tamils', 'The course provided a deep understanding of Tamil culture, literature, and traditions. It helped in appreciating the historical richness and values of Tamil heritage.', 'More multimedia presentations or field visits related to Tamil heritage could make the subject even more interesting.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'GE3171', 'Problem Solving and Python Programming Laboratory', 'The lab sessions were well-organized and helped in implementing theoretical concepts practically.', 'Adding a few mini-projects or coding competitions could make the sessions more engaging.', '2025-11-04 15:44:07'),
('Vishnu Priya', '953623243119', '2021', 'Sem I', 'BS3171', 'Physics and Chemistry Laboratory', 'The combined lab sessions helped in understanding the theoretical principles through experiments.', 'Including more modern instruments or digital data collection methods could further improve the lab experience.', '2025-11-04 15:44:07'),
