('A M DHANYA', '953623243007', '2021', 'Sem III', 'CS3152', 'Database Design and Management', 'The course gave a clear understanding of database concepts, ER models, SQL, and normalization. It built a strong base for real-world database handling.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem III', 'CS3153', 'Design and Analysis of Algorithms', 'This subject improved logical thinking and problem-solving skills through algorithm design and efficiency analysis. The teaching helped understand various algorithm techniques clearly.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem III', 'CS3154', 'Data Exploration and Visualization', 'The course helped in understanding data handling, visualization techniques, and analytical methods. It improved skills in interpreting data through graphs and charts.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem III', 'CS3155', 'Artificial Intelligence', 'The subject provided a good introduction to AI concepts, search algorithms, reasoning, and applications. The examples made it easier to relate AI to real-life situations', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem III', 'CS3171', 'Database Design and Management Laboratory', 'The lab sessions strengthened SQL and database implementation skills through hands-on practice. Working with queries improved logical database thinking.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem III', 'CS3172', 'Artificial Intelligence Laboratory', 'The lab improved practical understanding of AI concepts through coding-based experiments. Hands-on activities helped in applying theoretical knowledge effectively.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'MA3253', 'Probability and Statistics', 'The subject provided a strong foundation in probability concepts, statistical analysis, and data interpretation. The explanations were clear and helped in improving analytical skills.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'CS3156', 'Operating Systems', 'This course helped in understanding OS concepts such as process management, memory, scheduling, and file systems. The teaching was clear and supported conceptual learning effectively.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'CS3157', 'Machine Learning', 'The subject introduced core machine learning concepts and algorithms in an easy-to-understand manner. Examples and explanations helped relate theory to real-world applications.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'CS3158', 'Fundamentals of Data Science and Analytics', 'The course gave a clear understanding of data science workflow, data preprocessing, and analytical techniques. It built a strong base for data-driven decision-making.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'CS3159', 'Computer Networks', 'The subject provided a solid understanding of networking concepts, protocols, and communication models. The content was well-explained and easy to follow.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'GE3153', 'Environmental Sciences and Sustainability', 'The course created awareness about environmental issues, sustainability, and the importance of eco-friendly practices. It encouraged responsible behavior towards nature.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'CS3173', 'Data Science and Analytics Laboratory', 'The lab helped gain practical experience in data preprocessing, visualization, and analytical techniques. Hands-on exercises improved tool usage and problem-solving skills.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem IV', 'CS3174', 'Machine Learning Laboratory', 'The lab strengthened practical understanding of ML algorithms by implementing them through coding. It helped apply theoretical concepts effectively.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem V', 'CS3160', 'Deep Learning', 'The subject provided a clear introduction to deep learning concepts, neural networks, and architectures like CNNs and RNNs.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem V', 'CS3161', 'Data and Information Security', 'This subject helped understand important security concepts such as cryptography, network security, and data protection. It created awareness about cybersecurity threats and defense mechanisms.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem V', 'CS3162', 'Distributed Computing', 'The course gave a good understanding of distributed systems, communication models, and coordination mechanisms. Concepts were taught clearly with relevant examples.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem V', 'CS3163', 'Big Data Analytics', 'The subject provided a strong foundation in big data concepts, technologies, and data processing techniques. It helped understand how large-scale data is managed and analyzed.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem V', 'CS3175', 'Deep Learning Laboratory', 'The lab enhanced practical skills through coding-based implementation of deep learning models. Hands-on exercises helped relate theory to real-world AI applications', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'IP3151', 'Induction Programme', 'The Induction Programme was helpful in easing the transition into college life. The sessions encouraged interaction, teamwork, and self-confidence. Activities such as motivational talks, skill-building sessions, and club introductions helped students understand campus culture and available opportunities.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'HS3152', 'Professional English - I', 'The course improved communication skills, vocabulary, and confidence in speaking English. Classroom activities, role-plays, and writing tasks were useful for enhancing professional and academic language. The teaching approach was interactive and engaging.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'MA3151', 'Matrices and Calculus', 'The syllabus provided a strong foundation in calculus and matrices. Concepts were explained clearly with practical problem-solving practice. Regular assignments helped in improving analytical and mathematical skills.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'PH3151', 'Engineering Physics', 'Engineering Physics introduced students to fundamental scientific concepts needed for engineering. The topics were explained clearly, and examples were helpful in relating theory to applications.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'CY3151', 'Engineering Chemistry', 'The course covered essential chemistry concepts related to engineering. The teaching was informative, and real-world industrial examples were useful in understanding applications.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'GE3151', 'Problem Solving and Python Programming', 'The subject helped students develop logical thinking and basic programming skills. Programs were taught step-by-step, making it easier to understand Python concepts and apply them to problem solving.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'GE3152', 'தமிழர் மரபு / Heritage of Tamils', 'The course provided a deep understanding of Tamil culture, heritage, literature, and values. It created awareness of the rich history and traditions of the Tamil community.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'GE3171', 'Problem Solving and Python Programming Laboratory', 'The lab sessions helped reinforce programming concepts through hands-on practice. Students were able to write, debug, and execute Python code, improving logical and computational thinking skills.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'BS3171', 'Physics and Chemistry Laboratory', 'The laboratory sessions supported theoretical learning through experiments in physics and chemistry. The practical experiments were well-structured and improved observation, measurement, and analytical skills.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem I', 'GE3172', 'English Laboratory', 'The English Lab improved listening, speaking, and pronunciation skills. Activities like JAM sessions, group discussions, and role-plays helped build communication confidence.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'HS3252', 'Professional English - II', 'This subject improved my communication and presentation skills. Activities and classroom practices were helpful for professional English usage.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'MA3251', 'Statistics and Numerical Methods', 'The subject was useful for understanding statistics and numerical concepts with practical problem-solving. The explanations were clear and easy to follow.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'PH3256', 'Physics for Information Science', 'The subject helped connect physics concepts with information science applications. The topics were explained in a simple and understandable manner.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'BE3251', 'Basic Electrical and Electronics Engineering', 'This subject gave a good foundation in electrical and electronics basics. The concepts were explained clearly with suitable examples.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'GE3251', 'Engineering Graphics', 'Engineering Graphics improved my drawing and visualization skills. Regular practice helped in understanding projections and design concepts.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'AD3251', 'Data Structures Design', 'The subject improved logical thinking and coding skills through various data structure concepts. The examples helped in clear understanding.', '', '2025-11-04 15:46:06'),
