('A M DHANYA', '953623243007', '2021', 'Sem II', 'GE3271', 'Engineering Practices Laboratory', 'The lab sessions provided hands-on exposure to basic engineering tools and practices. It helped in improving practical knowledge and teamwork.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'AD3271', 'Data Structures Design Laboratory', 'The lab improved practical coding skills in implementing different data structures. Hands-on programs enhanced understanding of concepts.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem II', 'GE3272', 'Communication Laboratory / Foreign Language', 'The lab enhanced listening and speaking skills through interactive activities. It helped build confidence in communication.', '', '2025-11-04 15:46:06'),
('A M DHANYA', '953623243007', '2021', 'Sem III', 'MA3252', 'Discrete Mathematics', 'The subject helped build a strong foundation in logic, sets, relations, graphs, and combinatorics. The explanations were clear and supported problem-solving skill development.', '', '2025-11-04 15:46:06'),
