('Bhavani S', '953623243020', '2021', 'Sem II', 'GE3252', 'தமிழரும் தொழில்நுட்பமும் / Tamils and Technology', 'This subject showed how Tamil culture connects with technology and innovation. It was informative and thought-provoking.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem II', 'GE3271', 'Engineering Practices Laboratory', 'The lab sessions were very useful in learning basic engineering practices. It helped in understanding how different tools and instruments work.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem II', 'AD3271', 'Data Structures Design Laboratory', 'The lab helped in applying the data structure concepts learned in theory. It improved coding and debugging skills.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem II', 'GE3272', 'Communication Laboratory / Foreign Language', 'The communication lab improved listening, speaking, and writing skills. The interactive activities made learning enjoyable.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'MA3252', 'Discrete Mathematics', 'This subject helped in understanding mathematical logic, relations, and graph theory which are important for computer science. The explanations were clear and easy to follow.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'CS3151', 'Digital Principles and Computer Organization', 'The subject gave a good understanding of how computers work at the hardware level. The teacher explained complex topics like logic gates and memory organization clearly.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'CS3152', 'Database Design and Management', 'This subject helped in understanding how data is stored, organized, and managed efficiently. The practical examples and SQL exercises were very helpful.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'CS3153', 'Design and Analysis of Algorithms', 'The subject improved problem-solving and analytical skills. It explained how to design efficient algorithms and analyze their performance.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'CS3154', 'Data Exploration and Visualization', 'The subject gave a clear idea about handling and visualizing data using different tools and techniques. It was practical and interesting.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'CS3155', 'Artificial Intelligence', 'This subject introduced the basics of AI and its applications. The topics like search algorithms and machine learning concepts were explained clearly.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'CS3171', 'Database Design and Management Laboratory', 'The lab sessions were helpful in practicing SQL and database creation. It improved practical understanding of database concepts.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem III', 'CS3172', 'Artificial Intelligence Laboratory', 'The lab was very interesting and gave hands-on experience in implementing AI concepts. It helped in understanding how algorithms work in real situations.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'MA3253', 'Probability and Statistics', 'This subject helped in understanding data analysis and probability concepts clearly. The examples made the lessons easy to follow.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'CS3156', 'Operating Systems', 'The subject gave a clear understanding of how operating systems manage processes, memory, and files. The explanations were simple and effective.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'CS3157', 'Machine Learning', 'The subject introduced key machine learning concepts like regression, classification, and clustering in an easy way. The teaching was clear and well-structured.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'CS3158', 'Fundamentals of Data Science and Analytics', 'This subject gave a strong foundation in data science concepts and tools. It was useful in understanding how data is processed and analyzed.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'CS3159', 'Computer Networks', 'The subject explained how data is transmitted and managed in networks clearly. The diagrams and examples helped in understanding the concepts well.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'GE3153', 'Environmental Sciences and Sustainability', 'The subject created good awareness about the environment and sustainable practices. The topics were easy to understand and informative.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'CS3173', 'Data Science and Analytics Laboratory', 'The lab sessions helped in applying data science concepts practically. Working with datasets improved analytical and coding skills.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem IV', 'CS3174', 'Machine Learning Laboratory', 'This lab was very interesting and helped in understanding how machine learning algorithms work through practical implementation.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem V', 'CS3160', 'Deep Learning', 'This subject gave a clear understanding of neural networks and deep learning models. The concepts were explained in an easy and structured way.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem V', 'CS3161', 'Data and Information Security', 'The subject helped in understanding the importance of data protection, encryption, and cybersecurity concepts. The teaching was clear and informative.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem V', 'CS3162', 'Distributed Computing', 'This subject explained how distributed systems work and how tasks are shared among multiple computers. The lessons were detailed and easy to follow.', '', '2025-11-04 15:49:50'),
('Bhavani S', '953623243020', '2021', 'Sem V', 'CS3163', 'Big Data Analytics', 'The subject provided good knowledge about big data technologies and tools used for data processing. The content was practical and up to date.', '', '2025-11-04 15:49:50'),
