(2768, 110, 9, 57, 173, '', '2025-11-08 15:00:14', 'submitted', 'The sessions were well-organized and informative, helping us understand the academic environment and university culture.', 'The activities and interactions were very engaging and helped us adapt smoothly to college life.', 'Not applicable.', 'Not applicable.', 'The mentors used interactive and motivational methods that kept us active throughout the sessions.', 'The library orientation session was helpful in understanding how to access resources.'),
(2769, 110, 9, 57, 174, '', '2025-11-08 15:00:14', 'submitted', 'The faculty explained concepts clearly and encouraged class participation.', 'The syllabus improved our communication, grammar, and writing skills effectively.', 'The tests were fair and tested both understanding and application.', 'The English lab sessions were interactive and improved pronunciation and fluency.', 'Activities, discussions, and presentations made the classes lively.', 'Adequate English learning materials were available.'),
(2770, 110, 9, 57, 175, '', '2025-11-08 15:00:14', 'submitted', 'The teaching was systematic, and difficult concepts were explained with simple examples', 'The syllabus was well-structured and covered essential mathematical topics.', 'The questions tested understanding and problem-solving skills effectively.', 'Not applicable.', 'Regular problem-solving sessions helped strengthen our understanding.', 'The library had sufficient reference materials for further study.'),
(2771, 110, 9, 57, 176, '', '2025-11-08 15:00:14', 'submitted', 'The teacher explained each concept clearly with real-life examples.', 'The topics were relevant and helped us understand engineering applications of physics.', 'The exams were fair and covered both theoretical and conceptual understanding.', 'The laboratory experiments complemented the theory classes effectively.', 'Visual aids and demonstrations made the subject more interesting.', 'Physics reference books and journals were easily accessible.'),
(2772, 110, 9, 57, 177, '', '2025-11-08 15:00:14', 'submitted', 'The faculty taught each topic in an easy-to-understand manner with practical relevance', 'The syllabus connected chemistry principles to engineering applications effectively.', 'The exams were well-balanced and based on understanding rather than memorization.', 'The lab sessions were well-guided and improved our experimental skills.', 'The lectures were clear and supported by demonstrations.', 'Chemistry reference materials were well-maintained in the library.'),
(2773, 110, 9, 57, 178, '', '2025-11-08 15:00:14', 'submitted', 'The teacher explained programming concepts clearly and guided us through coding exercises.', 'The syllabus provided a good introduction to problem-solving using Python.', 'The assessments tested logical thinking and coding efficiency.', 'The lab support was excellent, and doubts were clarified promptly.', 'Hands-on sessions and coding tasks made learning engaging.', 'Programming books and online references were available.'),
(2774, 110, 9, 57, 179, '', '2025-11-08 15:00:14', 'submitted', 'The teaching was very clear and helped us appreciate Tamil heritage and culture.', 'The content was meaningful and highlighted the values, traditions, and contributions of Tamils.', 'The evaluation was simple and encouraged understanding of the subject.', 'Not applicable.', 'The interactive teaching style made the sessions enjoyable.', 'Reference materials related to Tamil culture were available.'),
(2775, 110, 9, 57, 180, '', '2025-11-08 15:00:14', 'submitted', 'The instructor provided excellent guidance during lab sessions and clarified doubts effectively.', 'The practical exercises helped us understand real-time coding applications.', 'The lab exams evaluated both accuracy and logical thinking.', 'Systems and software were well-maintained and functional.', 'The teacher encouraged independent coding and experimentation.', 'Good number of programming books and resources were available.'),
(2776, 110, 9, 57, 181, '', '2025-11-08 15:00:14', 'submitted', 'The lab instructors guided us carefully and ensured proper understanding of each experiment.', 'The experiments were well-selected and related to theoretical topics.', 'The practical tests were fair and tested our understanding and skills.', 'The lab facilities and instruments were well-maintained.', 'Demonstrations before each experiment were very helpful.', 'Reference manuals were available for each experiment.'),
(2777, 110, 9, 57, 182, '', '2025-11-08 15:00:14', 'submitted', 'The teacher guided us effectively and corrected our pronunciation and grammar with patience.', 'The syllabus focused on improving communication and listening skills.', 'The tests assessed real communication ability, not just memorization', 'The lab systems and software worked well for interactive learning.', 'Audio-visual methods made the learning environment engaging.', 'The library provided materials for self-practice in English.'),
(2778, 110, 9, 59, 193, '', '2025-11-08 15:00:14', 'submitted', 'The teacher explained each concept clearly with simple examples and logical reasoning.', 'The syllabus provided a strong foundation in logic, combinatorics, and graph theory.', 'The exams were balanced and tested both problem-solving and conceptual understanding.', 'Not applicable.', 'Step-by-step explanations and practice exercises helped in understanding complex topics.', 'Adequate reference materials and textbooks were available.'),
(2779, 110, 9, 59, 194, '', '2025-11-08 15:00:14', 'submitted', 'The faculty taught clearly, connecting digital logic concepts with computer architecture topics effectively.', 'The syllabus was comprehensive, covering number systems, logic design, and processor organization.', 'The exams tested practical understanding and application of theoretical concepts.', 'The lab experiments complemented the theory sessions well.', 'The use of diagrams and examples made the sessions engaging and easy to follow.', 'Sufficient books and study materials were available in the library.'),
(2780, 110, 9, 59, 195, '', '2025-11-08 15:00:14', 'submitted', 'The instructor explained database concepts and SQL queries clearly and effectively.', 'The syllabus was practical, focusing on real-world database design and management techniques.', 'The exams were fair and tested both theoretical knowledge and practical implementation.', 'The related lab sessions reinforced classroom learning.', 'Hands-on examples and problem-based teaching improved understanding.', '.Reference books and database manuals were readily available.'),
(2781, 110, 9, 59, 196, '', '2025-11-08 15:00:14', 'submitted', 'The teacher explained algorithms with clarity and provided step-by-step analysis for better understanding.', 'The syllabus covered important algorithmic techniques like divide-and-conquer, greedy, and dynamic programming.', 'The exams tested logic, problem-solving, and complexity analysis effectively.', 'The coding assignments and examples were helpful in grasping the concepts.', 'The teaching emphasized both theory and algorithmic implementation.', 'Adequate algorithm and data structure references were available.'),
